import React from 'react';

const Footer = () => (
    <footer className="p-8 bg-gray-800 text-white text-center">
        <div className="mb-4">
            <h2 className="text-2xl font-bold">Start learning with 67.1k students around the world.</h2>
            <button className="mt-4 px-6 py-3 bg-blue-600 text-white rounded hover:bg-blue-500">Join the Family</button>
        </div>
        <div className="mt-8 text-gray-400">
            {/* Add footer links and information */}
        </div>
    </footer>
);

